-- ----------------------------
-- Table structure for `exam_data`
-- ----------------------------
DROP TABLE IF EXISTS `exam_data`;
CREATE TABLE `exam_data` (
  `data_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '数据编号',
  `data_title` varchar(64) NOT NULL COMMENT '数据标题',
  `data_web` varchar(128) NOT NULL COMMENT '网址',
  `data_date` date NOT NULL COMMENT '日期',
  `state` tinyint(4) NOT NULL DEFAULT '1' COMMENT '删除标记 ',
  PRIMARY KEY (`data_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

