-- ----------------------------
-- Table structure for `exam_major`
-- ----------------------------
DROP TABLE IF EXISTS `exam_major`;
CREATE TABLE `exam_major` (
  `major_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '专业编号',
  `university_code` char(4) NOT NULL COMMENT '院校代号',
  `university_name` varchar(32) NOT NULL COMMENT '院校名称',
  `major_name` varchar(256) NOT NULL COMMENT '专业名称',
  `major_type` varchar(6) DEFAULT NULL COMMENT '专业类别',
  `major_level` varchar(2) DEFAULT NULL COMMENT '学科评估结果',
  `min2019` smallint(3) NOT NULL COMMENT '2019录取最低分',
  `min2018` smallint(3) DEFAULT NULL COMMENT '2018最低录取分',
  `min2017` smallint(3) DEFAULT NULL COMMENT '2017最低录取分',
  `pos2019` varchar(7) NOT NULL COMMENT '2019最低位次',
  `pos2018` varchar(7) DEFAULT NULL COMMENT '2018最低位次',
  `pos2017` varchar(7) DEFAULT NULL COMMENT '2017最低位次',
  `ave2019` smallint(3) NOT NULL COMMENT '2019平均分',
  `ave2018` smallint(3) DEFAULT NULL COMMENT '2018平均分',
  `ave2017` smallint(3) DEFAULT NULL COMMENT '2017最低分',
  `state` tinyint(4) NOT NULL DEFAULT '1' COMMENT '删除标记',
  PRIMARY KEY (`major_id`)
) ENGINE=InnoDB AUTO_INCREMENT=14036 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of exam_major
-- ----------------------------

