  `notice_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '通知编号',
  `notice_title` varchar(64) COLLATE utf8_unicode_ci NOT NULL COMMENT '通知标题',
  `notice_web` varchar(128) COLLATE utf8_unicode_ci NOT NULL COMMENT '网址',
