DROP TABLE IF EXISTS `exam_university`;
CREATE TABLE `exam_university` (
  `university_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `university_name` varchar(32) NOT NULL COMMENT '院校名称',
  `province` varchar(3) DEFAULT NULL COMMENT '省份',
  `city` varchar(11) DEFAULT NULL COMMENT '城市',
  `department` varchar(16) DEFAULT NULL COMMENT '主管部门',
  `type` char(2) DEFAULT NULL COMMENT '院校类型',
