  `university_211` tinyint(1) DEFAULT NULL COMMENT '211大学',
  `first_class` tinyint(1) DEFAULT NULL COMMENT '一流大学建设高校',
  `category` char(2) DEFAULT NULL COMMENT '类别',
  `website` varchar(128) DEFAULT NULL COMMENT '学校官网',
  `charter` varchar(128) DEFAULT NULL COMMENT '招生章程',
  `comment` varchar(16) DEFAULT NULL COMMENT '备注',
  `state` tinyint(4) NOT NULL DEFAULT '1' COMMENT '删除标记',
  PRIMARY KEY (`university_id`)
