  `subjects` varchar(6) NOT NULL COMMENT '选考科目',
  `state` tinyint(4) NOT NULL DEFAULT '1' COMMENT '删除标记 ',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

